import React from "react";
import Grid from "./components/grid/Grid";
import Header from "./components/header/header";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import SavedTemplate from "./components/savedTemplate/savedTemplate";
// import styles from "./app.module.css";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route
          exact
          path="/"
          element={
            <div>
              <Header /> <Grid />
            </div>
          }
        />
        <Route path="/saved" element={<SavedTemplate />} />
      </Routes>
    </BrowserRouter>

    // <div>
    //   <Header />
    //   <Grid />
    // </div>
  );
}

export default App;
